// Initial parameters
/**
 Jison parser
 */
alasql.parser = parser;

/**
 Jison parser
 @param {string} sql SQL statement
 @return {object} AST (Abstract Syntax Tree)
 */
alasql.parse = function(sql) {
	return parser.parse(alasql.utils.uncomment(sql));
}; // Shortcut

// Database Engines
/**
 List of engines of external databases
 */
alasql.engines = {};

// Databases
/**
 List of databases
 */
